using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.DependencyInjection;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace SurruhBackend.Models
{
    public class SeedData
    {
        public static void Initialize(IServiceProvider serviceProvider)
        {
            using (var context = new SurruhBackendContext(
                serviceProvider.GetRequiredService<DbContextOptions<SurruhBackendContext>>()))
            {

                var fruit = new Tag
                {
                    Name = "Fruit",
                };
                var vegetable = new Tag
                {
                    Name = "Vegetable",
                };
                if (context.Tags.Any() == false)
                {
                    context.Tags.Add(fruit);
                    context.Tags.Add(vegetable);
                }

                var appleImage = new Image
                {
                    Height = 320,
                    Width = 320,
                    ContentType = "image/png",
                    Length = 1,
                    Name = "apple",
                    Data = Convert.FromBase64String("")
                };
                var grapeImage = new Image
                {
                    Height = 1329,
                    Width = 2000,
                    ContentType = "image/jpeg",
                    Length = 1,
                    Name = "Grape",
                    Data = Convert.FromBase64String("")
                };
                var bananaImage = new Image
                {
                    Height = 540,
                    Width = 960,
                    ContentType = "image/jpeg",
                    Length = 1,
                    Name = "Banana",
                    Data = Convert.FromBase64String("")
                };
                var carrotImage = new Image
                {
                    Height = 600,
                    Width = 600,
                    ContentType = "image/png",
                    Length = 1,
                    Name = "Carrot",
                    Data = Convert.FromBase64String("")
                };
                if (context.Images.Any() == false)
                {
                    context.Images.Add(appleImage);
                    context.Images.Add(grapeImage);
                    context.Images.Add(bananaImage);
                    context.Images.Add(carrotImage);
                }

                var bananaData = new ImageData
                {
                    Name = "Banana",
                    Extension = "jpg",
                    CreatedDate = new DateTime(2017, 11, 20),
                    LastModified = new DateTime(2017, 11, 21),
                    Image = bananaImage,
                    IsVisible = true

                };
                var appleData = new ImageData
                {
                    Name = "Apple",
                    Extension = "png",
                    CreatedDate = new DateTime(2017, 12, 02),
                    LastModified = new DateTime(2018, 01, 20),
                    Image = appleImage,
                    IsVisible = false
                };
                var grapeData = new ImageData
                {
                    Name = "Grape",
                    Extension = "jpg",
                    CreatedDate = new DateTime(2018, 01, 20),
                    LastModified = new DateTime(2018, 02, 01),
                    Image = grapeImage,
                    IsVisible = true

                };
                var carrotData = new ImageData
                {
                    Name = "Carrot",
                    Extension = "png",
                    CreatedDate = new DateTime(2018, 02, 02),
                    LastModified = new DateTime(2018, 02, 10),
                    Image = carrotImage,
                    IsVisible = true,
                };

                if (context.ImageData.Any() == false)
                {
                    context.ImageData.Add(appleData);
                    context.ImageData.Add(bananaData);
                    context.ImageData.Add(grapeData);
                    context.ImageData.Add(carrotData);

                    context.AddRange(
                    new ImageData_Tag { ImageData = appleData, Tag = fruit },
                    new ImageData_Tag { ImageData = grapeData, Tag = fruit },
                    new ImageData_Tag { ImageData = bananaData, Tag = fruit },
                    new ImageData_Tag { ImageData = carrotData, Tag = vegetable });
                }

                if (context.ProductOptions.Any() == false)
                {
                    ProductOption appleRedOption = new ProductOption
                    {
                        Name = "Red",
                        Price = 1.99
                    };

                    ProductOption applePinkOption = new ProductOption
                    {
                        Name = "Pink Lady",
                       // ImageData = new List<ImageData> { appleData },
                        Price = 2.25
                    };

                    ProductOption carrotBabyOption = new ProductOption
                    {
                        Name = "Baby",
                       // ImageData = new List<ImageData> { carrotData },
                        Price = 1.25
                    };

                    ProductOption grapePurple = new ProductOption
                    {
                        Name = "Purple",
                        //ImageData = new List<ImageData> { grapeData },
                        Price = .99
                    };

                    ProductOption organicBanana = new ProductOption
                    {
                        Name = "Organic",
                       // ImageData = new List<ImageData> { bananaData },
                        Price = 1.00
                    };

                    context.AddRange(
                        new ProductOption_ImageData { ImageData = appleData, ProductOption = appleRedOption },
                        new ProductOption_ImageData { ImageData = appleData, ProductOption = applePinkOption },
                        new ProductOption_ImageData { ImageData = grapeData, ProductOption = grapePurple },
                        new ProductOption_ImageData { ImageData = bananaData, ProductOption = organicBanana },
                        new ProductOption_ImageData { ImageData = carrotData, ProductOption = carrotBabyOption } 
                    );

                    context.ProductOptions.AddRange(applePinkOption, appleRedOption, carrotBabyOption, grapePurple, organicBanana);

                    Product apple = new Product
                    {
                        Name = "Apple",
                        ProductDescription = "An apple is a sweet, edible fruit produced by an apple tree.",
                        ProductOptions = new ProductOption[] { applePinkOption, appleRedOption }
                    };

                    Product carrot = new Product
                    {
                        Name = "Carrot",
                        ProductDescription = "A carrot is a root vegetable, usually orange in colour, though purple, black, red, white, and yellow cultivars exist.",
                        ProductOptions = new ProductOption[] { carrotBabyOption }
                    };

                    Product grape = new Product
                    {
                        Name = "Grape",
                        ProductDescription = "A grape is a fruit, botanically a berry, of the deciduous woody vines of the flowering plant genus Vitis.",
                        ProductOptions = new ProductOption[] { grapePurple }
                    };

                    Product banana = new Product
                    {
                        Name = "Banana",
                        ProductDescription = "The banana is an edible fruit – botanically a berry – produced by several kinds of large herbaceous flowering plants in the genus Musa.",
                        ProductOptions = new ProductOption[] { organicBanana }
                    };

                    context.Products.AddRange(apple, carrot, grape, banana);
                }



                    context.SaveChanges();
            }
        }
    }
}
